css:
@-moz-document domain("btbit.net") {
.rs {
    background-color: #000000bd;
}

body,
html {
    background-color: #000000bd
}

.rs .title {
    padding: 8px 15px;
    border-bottom: 1px solid #b7b7b700;
    border-color: #000;
    background-color: #020202;
    color: #444;
}

.rs .like {
    color: #4f4f4f;
}

.rs .slist,
.rs .slist p {
    color: #6a6a6a !important;
}

.sort-box {
    background: #2f2f2f;
}

.rs .like a:hover {
    background: #333;
    color: #fff;
}

.red {
    color: #1f98ff;
}

.rs .sbar b {
    color: #1f98ff;
}

.rs .title h3 a {
    color: #87878a;
}
}
